    <child ID="2037"
        label="If the triple store we use distinguishes &#xa;      different directories and each directory has a default graph (that can be the union of all named graphs) and n named graphs, and if it is also possible to have subdirectories, we could have a first level of directories that refer to the different workspaces we have (1 published, 1 draft, each project, each lab, each journal). The second level of directories (subdirectories) would be defined by the different types of entries we have in SOCCOMAS. The third level of directories would be defined based on different named graph classes [ngc]. Below is an example of various named graphs of an indivdual Entry. Each named graph would be located in the directory of the respective named graph class [ngc]. In other words, all 'Header' named graphs would be located in the 'Header' subdirectory of the  entry type subdirectory of the corresponding workspace directory."
        layerID="1" created="1553350714244" x="69.3858" y="451.43552"
        width="713.0" height="233.0" strokeWidth="0.0" autoSized="false" xsi:type="text">
        <strokeColor>#404040</strokeColor>
        <textColor>#000000</textColor>
        <font>-plain-16</font>
        <URIString>http://vue.tufts.edu/rdf/resource/aaf483ccc0a8b240009362a015e6dd1f</URIString>
        <richText>&lt;html&gt;
  &lt;head&gt;
    &lt;style type="text/css"&gt;
      &lt;!--
        body { color: #005e9c; font-family: Arial; font-size: 12; margin-left: 0px; margin-bottom: 0px; margin-top: 0px; margin-right: 0px }
        ol { font-family: Arial; list-style-position: outside; margin-left: 30; font-size: 12; margin-top: 6; vertical-align: middle }
        p { color: #005e9c; margin-left: 0; margin-bottom: 0; margin-top: 0; margin-right: 0 }
        ul { font-family: Arial; list-style-position: outside; margin-left: 30; font-size: 12; margin-top: 6; vertical-align: middle }
      --&gt;
    &lt;/style&gt;
    
  &lt;/head&gt;
  &lt;body&gt;
    &lt;p color="#005e9c" style="color: #005e9c"&gt;
      &lt;font style="font-size:16;"&gt;If the triple store we use distinguishes 
      different directories and each directory has a default graph (that can 
      be the union of all named graphs) and n named graphs, and if it is also 
      possible to have subdirectories, we could have a first level of 
      directories that refer to the different workspaces we have (1 published, 
      1 draft, each project, each lab, each journal). The second level of 
      directories (subdirectories) would be defined by the different types of 
      entries we have in SOCCOMAS. The third level of directories would be 
      defined based on different named graph classes [ngc].&lt;/font&gt;
    &lt;/p&gt;
    &lt;p color="#005e9c" style="color: #005e9c"&gt;
      
    &lt;/p&gt;
    &lt;p color="#005e9c" style="color: #005e9c"&gt;
      &lt;font style="font-size:16;"&gt;Below is an example of various named graphs 
      of an indivdual Entry. Each named graph would be located in the 
      directory of the respective named graph class [ngc]. In other words, all 
      'Header' named graphs would be located in the 'Header' subdirectory of 
      the entry type subdirectory of the corresponding workspace directory. &lt;/font&gt;
    &lt;/p&gt;
    &lt;p color="#005e9c" style="color: #005e9c"&gt;
      
    &lt;/p&gt;
  &lt;/body&gt;
&lt;/html&gt;
</richText>
        <label>If the triple store we use distinguishes 
      different directories and each directory has a default graph (that can be the union of all named graphs) and n named graphs, and if it is also possible to have subdirectories, we could have a first level of directories that refer to the different workspaces we have (1 published, 1 draft, each project, each lab, each journal). The second level of directories (subdirectories) would be defined by the different types of entries we have in SOCCOMAS. The third level of directories would be defined based on different named graph classes [ngc]. Below is an example of various named graphs of an indivdual Entry. Each named graph would be located in the directory of the respective named graph class [ngc]. In other words, all 'Header' named graphs would be located in the 'Header' subdirectory of the  entry type subdirectory of the corresponding workspace directory.</label>
    </child>
